import './styles.css';
import Container from 'react-bootstrap/Container';
const Footer = () => {

    return (
        <div className='footer'>
            <Container>
                <div>
                    <h1 style={{
                        marginTop: '10px',
                        fontFamily: 'Ledger, serif',
                        fontSize: '28px',
                    }}>Clinic</h1>
                    <h1 style={{
                        marginTop: '10px',
                        fontFamily: 'Ledger, serif',
                        fontSize: '28px',
                    }}>Social Media</h1>
                </div>
            </Container>
        </div>
    )

  };

export default Footer;
